import classes from './NotFound.module.css';
import Logo from '../../../../public/cerebral_icon.png';

const notFound = () => (
    <div className={classes.NotFound}>
        <img />
        <h1>404</h1>
        <h2>Page Not Found</h2>
    </div>
);

export default notFound
